x._operation:
Utils.onLine({
    'y': anchors[0].y + serifHeight + serifCurve,
    'on': [
        parentAnchors[0].base,
        parentAnchors[0].obliqueEndPoint
    ]
})

Utils.onLine({
    'y': anchors[0].y + serifHeight,
    'on': [
        parentAnchors[0].base,
        parentAnchors[0].obliqueEndPoint
    ]
}) - Math.abs(Math.max((contours[0].nodes[2].x - Utils.onLine({
