        parentAnchors[0].base,
        parentAnchors[0].obliqueEndPoint
    ]
})) * 0.85 * anchors[3].scaleX, -Math.abs(contours[0].nodes[0].y - (anchors[0].y + serifHeight)))) * anchors[3].scaleX

y._operation:
anchors[0].y + serifHeight - Math.max(0, (contours[0].nodes[1].x - Utils.onLine({
    'y': anchors[0].y + serifHeight,
    'on': [
        parentAnchors[0].base,
        parentAnchors[0].obliqueEndPoint
    ]
})) * anchors[3].scaleX) * anchors[3].scaleX / ((serifWidth || 0.01) - Math.abs(Utils.onLine({
